function sendDirectPacket(channel, start, count, data,apply){

    var packet = [];         
    packet[0] = 0xEC;
    packet[1] = 0x40;
    packet[2] = apply ? 0x80 | channel : channel;
    packet[3] = start;
    packet[4] = count;
    packet = packet.concat(data);

    device.write(packet, 65);
}

function setDirectMode(){
    var packet = [0xEC, 0x3B, 0x00, 0xFF];
    device.write(packet,65)
}

